import ExpenseItem from "./components/Expenses/ExpenseItem";
import NewExpense from "./components/New Expense/NewExpense";

function App() {
    const [expenses, setExpenses] = useState([]);

    return (
        <div>
            <NewExpense />
            <ExpenseItem
                name="Car Insurance"
                price="293.4"
                date="12th January 2022"
            />
            <ExpenseItem
                name="Internet Costs"
                price="15"
                date="31th November 2022"
            />
        </div>
    );
}

export default App;
